.heading_top {position: relative;width:100%;margin: auto;display:block;margin-top: 20px;}
.sidebar {top:0px;right:0px;padding:5px;margin:5px;position:fixed;display:block;font-size:14px;}
.alert {padding: 15px;margin-bottom: 20px;border: 1px solid transparent;border-radius: 4px;}
.alert-info {background: #ffe193;border: 1px solid #ffffff;color: #544b32;border-radius: 4px;-webkit-box-shadow: 0 1px 2px 0 rgba(0, 0, 0, .1);-moz-box-shadow: 0 1px 2px 0 rgba(0, 0, 0, .1);box-shadow: 0 1px 2px 0 rgba(0, 0, 0, .1)}
