.btn-default {color: #333;background-color: #fff;border-color: #ccc;}
.btn-default:hover {color: #333;background-color: #e6e6e6;border-color: #adadad;}
.btn-default:focus, .btn-default.focus {color: #333;background-color: #e6e6e6;border-color: #8c8c8c;}
.btn-default:active, .btn-default.active, .open > .dropdown-toggle.btn-default {color: #333;background-color: #e6e6e6;border-color: #adadad;}
a {color: #337ab7;text-decoration: none;}
a:hover,a:focus {color: #23527c;text-decoration: none;}
a:focus {outline: 5px auto -webkit-focus-ring-color;outline-offset: -2px;}
select {-webkit-appearance: none;-moz-appearance: none;appearance: none;background: url("img/btn_down.png") white no-repeat 95.5% !important;background: url("img/btn_down.png") white no-repeat calc(100% - 10px) !important;}
